import React, { useState } from "react";

const SearchPage: React.FC = () => {
  const [query, setQuery] = useState("");
  const [results, setResults] = useState<string[]>([]);

  const handleSearch = (e: React.FormEvent) => {
    e.preventDefault();
    // 실제로는 API 호출해서 결과 받아오면 됨
    setResults([
      "로봇이 블록을 파지하는 장면",
      "작업자가 로봇 동작을 모니터링",
      "로봇이 대상을 옮기는 모습",
      "안전 구역에서 대기하는 작업자",
      "대상을 컵에 넣는 장면",
      "로봇이 자세를 조정하는 동작"
    ]);
  };

  return (
    <div className="min-h-screen flex flex-col items-center bg-gradient-to-br from-indigo-100 via-white to-indigo-50 py-10">
      <div className="w-full max-w-md p-8 bg-white rounded-2xl shadow-lg mb-8">
        <h1 className="text-2xl font-bold text-center text-indigo-600 mb-6">
          🔍 영상 검색
        </h1>
        <form onSubmit={handleSearch} className="flex gap-2">
          <input
            type="text"
            placeholder="검색어를 입력하세요..."
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            className="flex-1 p-3 rounded-xl border border-gray-300 focus:outline-none focus:ring-2 focus:ring-indigo-400"
          />
          <button
            type="submit"
            className="px-5 py-3 bg-indigo-500 text-white rounded-xl shadow hover:bg-indigo-600 transition"
          >
            검색
          </button>
        </form>
      </div>

      {/* 🔽 검색 결과 */}
      <div className="w-full max-w-4xl grid grid-cols-1 sm:grid-cols-2 gap-6 px-4">
        {results.map((item, idx) => (
          <div
            key={idx}
            className="p-6 bg-white rounded-2xl shadow hover:shadow-xl transition"
          >
            <h2 className="text-lg font-semibold text-gray-700 mb-2">
              {item}
            </h2>
            <p className="text-sm text-gray-500">검색 결과 설명 #{idx + 1}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default SearchPage;
